import re
import json


def test1(str):
    objList = json.loads(str)
    result = []
    for obj in objList:
        if (len(result) == 0 or obj['type'] != 203):
            result.append(obj)
        else:
            apiName, dataIds, fieldApiNames = get(obj)
            needFieldApiName = [x for x in fieldApiNames]
            for r in result:
                rApiName, rdataIds, rfieldApiNames = get(r)
                if (apiName != rApiName):
                    continue
                # 如果dataIds是子集
                if (dataIds.issubset(rdataIds)):
                    rfieldApiNames = rfieldApiNames.union(fieldApiNames)
                    r['fieldApiNames'] = list(rfieldApiNames)
                    needFieldApiName = []
                    continue
                for fieldApiName in fieldApiNames:
                    if (fieldApiName in rfieldApiNames):
                        rdataIds = rdataIds.union(dataIds)
                        r['dataIds'] = list(rdataIds)
                        needFieldApiName.remove(fieldApiName)

            if (len(needFieldApiName) > 0):
                obj['fieldApiNames'] = needFieldApiName
                result.append(obj)
    return result


def get(obj):
    return obj['objectDescribeApiName'], set(obj['dataIds']), set(obj['fieldApiNames'])


